INSERT INTO $$STGDB.WI_AR_SUMMARY_QUOTE_SMC SELECT SALES_ORDER_LINE_KEY, DV_EFFECTIVE_DTM, CASE WHEN SO_CNT > 1 THEN 'MIX' ELSE SALES_MOTION_CD END SALES_MOTION_CD, USER EDW_CREATE_USER, CURRENT_TIMESTAMP(0) EDW_CREATE_DTM FROM ( SELECT SALES_ORDER_LINE_KEY, SALES_MOTION_CD, MAX(DV_EFFECTIVE_DTM) OVER(PARTITION BY SALES_ORDER_LINE_KEY) AS DV_EFFECTIVE_DTM, COUNT(*) OVER(PARTITION BY SALES_ORDER_LINE_KEY) SO_CNT, SUM(DV_ALLOCATION_PCT) OVER(PARTITION BY SALES_ORDER_LINE_KEY) DV_ALLOCATION_PCT FROM ( SELECT SALES_ORDER_LINE_KEY, SALES_MOTION_CD, DV_EFFECTIVE_DTM, EDW_UPDATE_DTM, SUM(DV_ALLOCATION_PCT) OVER(PARTITION BY SALES_ORDER_LINE_KEY ) SUM_ALLOCATION_PCT, CAST( DV_ALLOCATION_PCT/SUM_ALLOCATION_PCT AS DECIMAL(18,6) ) AS DV_ALLOCATION_PCT /* Included inner query part to handle CS SQ scenario Sep 26 Q2FY20 Release */ FROM $$SLSORDVWDB.MT_SUMMARY_QUOTE_SOL_ALLOC WHERE DV_EXPIRATION_DTM = '3500-01-01 00:00:00' AND SALES_ORDER_LINE_KEY IN ( SELECT SALES_ORDER_LINE_KEY FROM $$SLSORDVWDB.MT_SUMMARY_QUOTE_SOL_ALLOC WHERE EDW_UPDATE_DTM > ( SELECT LAST_EXTRACT_DATE FROM $$ETLVWDB.CTL_ETL_LAST_EXTRACT_DATES WHERE JOB_STREAM_ID = 'wf_WI_RTE_NET_CHANGE_FOR_BKG' AND TABLE_NAME = 'WI_AR_SUMMARY_QUOTE_SMC' ) ) /* For identifying all open records for a particular allocation change*/ ) WI ) WI WHERE ROUND(DV_ALLOCATION_PCT) = 1.00 GROUP BY 1,2,3,4,5 ;
CALL COLLECT_STATS_WRAP('$$STGDB', 'WI_AR_SUMMARY_QUOTE_SMC', 'D') ;
UPDATE WI_AR FROM $$STGDB.WI_AR_SALES_MOTION_CHANGE WI_AR, ( SELECT SALES_ORDER_LINE_KEY, SALES_MOTION_CD , DV_EFFECTIVE_DTM FROM $$STGDB.WI_AR_SUMMARY_QUOTE_SMC ) WI SET SALES_MOTION_CD = WI.SALES_MOTION_CD , SOURCE_COMMIT_TIME = WI.DV_EFFECTIVE_DTM, EDW_UPDATE_DTM = CURRENT_TIMESTAMP(0) WHERE WI_AR.SALES_ORDER_LINE_KEY = WI.SALES_ORDER_LINE_KEY AND WI_AR.EDW_UPDATE_DTM < WI.DV_EFFECTIVE_DTM;
UPDATE EL FROM $$ETLVWDB.CTL_ETL_LAST_EXTRACT_DATES EL, ( SELECT MAX(EDW_UPDATE_DTM) MAX_UPD_DATE FROM $$SLSORDVWDB.MT_SUMMARY_QUOTE_SOL_ALLOC ) NSOL SET LAST_EXTRACT_DATE = COALESCE(NSOL.MAX_UPD_DATE , EL.LAST_EXTRACT_DATE ) WHERE JOB_STREAM_ID = 'wf_WI_RTE_NET_CHANGE_FOR_BKG' AND TABLE_NAME = 'WI_AR_SUMMARY_QUOTE_SMC'; /* Added as part of December RTNR release */
